	-- Profile import
	Details:ImportProfile((scaled and profileStringScaled) or profileStringNative, name)

	-- Apply the profile
	if Details:GetCurrentProfileName() ~= name then
		Details:ApplyProfile(name)
	end

	-- Load the profile on all characters
